      <p>Today at <a href="http://www.dirtydawgz.net/">Dirty Dawgz</a> the fine people from <a href="http://www.operationkindness.org/index.php">Operation Kindness</a> were offering cheap dog baths with complementary nail clippings.</p>
      <p>Casie wasn't to sure if she wanted to go since it's raining. Conney <strong>hates</strong> the rain. She's not a big fan of baths either. I insisted we take her since Conney really needed her nails clipped and neither of us has any idea how to do it.</p>
